import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'

class App extends React.Component{

  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', lastName:'Payne'}))
  }

  render(){
    {
      console.log("-")
      console.log(this.props)
    }
    return (
      <div className="App">
        <h3> 
            {'Name: ' +
             (this.props.step1.name.firstName == undefined?'':', ' + this.props.step1.name.firstName)+ 
             (this.props.step1.name.middleName == undefined?'':', ' + this.props.step1.name.middleName)+ ', ' +
             (this.props.step1.name.lastName== undefined?'':', ' + this.props.step1.name.lastName)
             }
        </h3>
        <button onClick={this.doThing}> Click! </button>
      </div>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
